script: |
  super -f text -I q6191.spq | sort > q6191.out

inputs:
  - name: q6191.spq
    data: |
      SELECT DISTINCT col2 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col2 + 97 BETWEEN NULL AND + - col0 / - col0 + - col2;
  - name: tab1

outputs:
  - name: q6191.out
    data: |
      59
      68
      96
